import React, { useState } from "react";
import LandingPage from "./landingPage"; // Your landing page component
import Map from "./Map"; // Your map component
import "./App.css"; // Add CSS for the fade-in effect

function App() {
  const [showMap, setShowMap] = useState(false);

  const handleStart = () => {
    setShowMap(true); // Show the map when clicking "Get Started"
  };

  return (
    <div className="app">
      {!showMap && <LandingPage onStart={handleStart} />}
      {showMap && (
        <div className="map-container fade-in">
          <Map />
        </div>
      )}
    </div>
  );
}

export default App;
